from matplotlib import pyplot as plt

def afficher_ligne(ax, ligne, coul):
    abscisses = [point[0] for point in ligne]
    ordonnees = [point[1] for point in ligne]
    ax.plot(abscisses, ordonnees, "-" + coul, linewidth=0.8)

def comparer_avant_apres(ligne, simplifie, seuil):
    """
    Affiche à gauche la ligne brisée de départ et à droite sa version simplifiée.
    - Entrées : ligne (liste de points ou liste de listes de points),
                simplifie (fonction de simplification),
                seuil (flottant)
    Effet de bord : affichage dans le carnet Jupyter
    """
    if type(ligne[0]) == tuple:
        comparer_avant_apres([ligne], simplifie, seuil)
    else:
        fig = plt.figure(figsize=(12, 6))
        ax1 = fig.add_subplot(121)
        ax2 = fig.add_subplot(122)
        ax1.axis('equal')
        ax1.set_axis_off()
        ax2.axis('equal')
        ax2.set_axis_off()      
        cpt1, cpt2 = 0, 0
        for k in range(len(ligne)):
            ligne_simplifiee = simplifie(ligne[k], seuil)
            afficher_ligne(ax1, ligne[k], "k")
            afficher_ligne(ax2, ligne_simplifiee, "k")
            cpt1, cpt2 = cpt1 + len(ligne[k])-1, cpt2 + len(ligne_simplifiee)-1
        ax1.set_title(f"Avant : {cpt1} sommets")
        ax2.set_title(f"Après : {cpt2} sommets")

